package BucleDoWhile;

public class Ejemplo1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int i=0;
        do {
        	System.out.println("Interaccion " + i);
        	i++;
        }while(i<5);
        System.out.println("WHILE------- ");
        
	}

}
